import React from 'react';
import {  } from './PurposeElements';
import { Parallax } from 'react-parallax';

const Purpose = () => {
  return (
    <>
      <Parallax strength={300}>
        <div class = "home_header"><h2>Our Purpose</h2></div>
      </Parallax>
    </>
  );
};

export default Purpose;
